import logo from './logo.svg';
import './App.css';
import {Routes , Route} from 'react-router-dom';
import Home from './Components/Home'
import Payment from './Components/Payment'
import CartoDB from './Components/ca'
function App() {
  return (
    <div className="App">
      <Routes >
        <Route
          path = '/' element ={<Home />}  />
           <Route
          path = '/payment' element ={<Payment />}  />
           <Route
          path = '/payment' element ={<Payment />}  />

      </Routes>
    </div>
  );
}

export default App;
